import React from "react";
import {Container, Row, Col} from "react-bootstrap";

class Header extends React.Component {
    render() {
        return (
            <Container fluid>
                <Col md-6>
                    Dit is een col
                </Col>
            </Container>
        );
    }
}

export default Header;
